import React from 'react';
import { Photos } from '../components/Album/photos/Photos';

import './AlbumsPage.css';

export default function AlbumsPage(){
        
        return (
            <main className='albumpage'>
                <div className='photos'>
                <img src={Photos.map((image) => {
                    return (
                        <Album
                    image = {image.img}
                    imgalt={image.id} 
                    />
                    )
                })} />
                </div>
            </main>
          );
  };
